import { formatDate, useRefHistory } from '@vueuse/core'
import { shallowRef } from 'vue'

function format(ts: number) {
  return formatDate(new Date(ts), 'YYYY-MM-DD HH:mm:ss')
}

const count = shallowRef(0)

function inc() {
  count.value++
}

function dec() {
  count.value--
}

